set foreign_key_checks = 1;
INSERT INTO PRODUCT_VARIANT_INVENTORY (CREATED_BY, CREATED_DATE)
SELECT user.ID,
       NOW() - INTERVAL FLOOR(RAND() * 365) DAY -- RANDOM DATE WITHIN THE LAST YEAR
FROM (SELECT ID FROM APP_USER ORDER BY RAND() LIMIT 10) user,
     (SELECT 1 UNION SELECT 2 UNION SELECT 3) number_items;

DELETE
FROM VARIANT_INVENTORY_DETAIL;
INSERT INTO VARIANT_INVENTORY_DETAIL (quantity, variant_id, inventory_id)
SELECT CEIL(RAND() * 100), -- RANDOM QUANTITY BETWEEN 0 AND 99
       (SELECT id FROM PRODUCT_VARIANT ORDER BY RAND() LIMIT 1) as variant_id,
       inventory.ID        -- ASSUMING YOU HAVE A TABLE NAMED PRODUCT_VARIANT WITH AN ID COLUMN
FROM (SELECT id FROM PRODUCT_VARIANT_INVENTORY ORDER BY ID) inventory,
     (SELECT 1 UNION SELECT 2 UNION SELECT 3) number_items
ORDER BY inventory.ID;

DELETE
FROM ORDER_ITEM;
INSERT INTO ORDER_ITEM (PRICE, QUANTITY, VARIANT_ID, ORDER_ID)
SELECT (SELECT PRICE
        FROM PRODUCT_VARIANT
        ORDER BY RAND()
        LIMIT 1)         AS PRICE,
       CEIL(RAND() * 10) AS QUANTITY,
       variant.ID,
       `order`.ID
FROM (SELECT ID FROM APP_ORDER) `order`,
     (SELECT ID FROM PRODUCT_VARIANT ORDER BY RAND() LIMIT 5) variant
ORDER BY `order`.ID;

INSERT INTO REVIEW(comment, created_at, rating, product_id, user_id)
SELECT REVIEW.comment,
       NOW() - INTERVAL FLOOR(RAND() * 365) DAY,
       CEIL(RAND() * 3) + 2,
       product.id,
       app_user.id
FROM (SELECT comment, created_at, rating, product_id, user_id FROM review ORDER BY RAND() LIMIT 5) REVIEW,
     (SELECT id FROM product ORDER BY RAND() LIMIT 50) product,
     (SELECT id FROM app_user ORDER BY RAND() LIMIT 5) app_user;
